description:
Title: Sinistar Unleashed
Developer: GameFX Technology
Publisher: THQ Inc.
Genre: Space shooter
Released: 1999
Description: You get sucked through a wormhole into the alternate universe of the Sinistar, where your spaceship is transformed into a strange organic living spaceship. In center of each level is a huge jumpgate that evil worker drones are busy powering up by attaching sinisite crystals to it. Once the gate is fully powered an enormous, very agressive boss monster comes out of it, the Sinistar.

Installation:
1) Mount or burn game image;
2) Install the game;
3) Apply patch from Patch dir;
4) Play the game with the CD, because I couldn't find a working crack;
5) Support the producer.
